  overflow-scrolling: touch;
  touch-action: auto;
  background-color: #ebeef4;
}
.hairline-border {
  position: relative;
}
.hairline-border::after {
  position: absolute;
  box-sizing: border-box;
  content: " ";
  pointer-events: none;
  top: -50%;
  right: -50%;
  bottom: -50%;
  left: -50%;
  border: 1px solid #d6dce8 !important;
  transform: scale(0.5);
}
.ellipsis {
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}

:root {
